import React from 'react' 
import './project.scss' 

function Projects() { 
    return ( 
        <div className="container projectContainer"> 
            <div className="d-flex"> 
                <img src="/static/images/projects.png" alt="logo"/>
                <h1>Projects</h1> 
            </div> 
            <div class="card-deck">
                
            </div>
        </div> 
    ) 
} 

export default Projects;
